import React from 'react';
import axios from "axios";


function App() {
  const [numInput, setNumInput] = React.useState('');
  const [letterCombosData, setletterCombosData] = React.useState();

  return (
    <div>
      <h1>Phone Words</h1>
        <input 
          placeholder="e.g 234"
            onChange={(event) => {
                setNumInput(event.target.value);
            }}
            value={numInput}
        />
      <button onClick={async () => {
        console.log('getting letter combos for ' + numInput);
        axios
          .post(
              `http://localhost:8080/phonewords`, 
              { numericStr: numInput }
          )
          .then(response => {
              console.log(response.data.letterCombos)
              const letterCombos = response.data.letterCombos.toString()
              setletterCombosData(letterCombos);

          })
          .catch(err => {
              console.log(err)
          });
      }}>Get letter combinations</button>

      {letterCombosData && (
        <p style={{
            backgroundColor: "red",
          }}
        >Combinations: {letterCombosData}</p>
      )}

    </div>
  );
}

export default App;
